import React from 'react';
import '../App.css';


function ProjectPreview(projectName,projectType, projectRole) {
    return(
        <div className="project-preview">
            <h2>{this.props.projectName}</h2>
            <h3>{projectType}</h3>
            <h3>{projectRole}</h3>
        </div>
    )
}

export default ProjectPreview;
